#include <vector>
#include <unordered_map>
#include <iostream>

using namespace std;

class TwoSum {
private:
    vector<int> vec; // 服务双指针法，保持有序，方便二分法查找
    unordered_map<int, int> hash_map; // 服务hash_map法，记录下标
    std::string str{"hash_map"};
    std::pair<int, int> nums;
public:
    int target{-1};
    TwoSum() {}
    TwoSum(std::string str) : str(str) {}
    /**
     * @param number: An integer
     * @return: nothing
     */
    inline std::pair<int,int> get_nums() { return nums; }
    void add(int number) {
        // write your code here
        if (str == "vector") {
            add_vec(number);
        } else if (str == "hash_map") {
            add_hash_map(number);
        } else if (str == "tree_map") {
            add_tree_map(number);
        }
    }

    /**
     * @param value: An integer
     * @return: Find if there exists any pair of numbers which sum is equal to the value.
     */
    bool find(int value) {
        target = value;
        // write your code here
        if (str == "vector") {
            return find_vec(value);
        } else if (str == "hash_map") {
            return find_hash_map(value);
        } else if (str == "tree_map") {
            return find_tree_map(value);
        }
        return false;
    }

    void add_tree_map(int i) {
        // TODO
    }

    bool find_tree_map(int target) {
        // TODO
        return false;
    }

    void add_vec(int i) { // O(n)
        vec.push_back(i);
        for (int i = vec.size() - 1; i > 0; i--) {
            if (vec[i] < vec[i - 1]) {
                swap(vec[i], vec[i - 1]);
                continue;
            }
            break;
        }
    }
    void print_vec() {
        cout << "vec: [";
        for (auto i : vec) {
            cout << i << " ";
        }
        cout << "]" << endl;
    }

    // O(n), 双指针法，
    // 也可以二分法O(logn)，但是如果插入O(n)和查询O(logn)次数相当，那么总的时间复杂度仍然是O(n),不会提升性能
    // 二分法查询+链表法插入，O(logn) + O(n)，也不会提升性能
    bool find_vec(int target) {
        int lpos = 0;
        int rpos = vec.size() - 1;
        while(lpos < rpos) {
            if (vec[lpos] + vec[rpos] > target) {
                --rpos;
            } else if (vec[lpos] + vec[rpos] < target) {
                ++lpos;
            } else {
                nums.first = vec[lpos];
                nums.second = vec[rpos];
                return true;
            }
        }
        return false;
    }

    void add_hash_map(int i) { // O(1)
        auto it = hash_map.find(i);
        if (it != hash_map.end()) {
            it->second++;
        } else {
            hash_map[i] = 1;
        }
    }

    bool find_hash_map(int target) { // O(n)
        for (auto& it : hash_map) {
            int tofind = target - it.first;
            auto _it = hash_map.find(tofind);
            if (_it != hash_map.end()) {
                if ((it.first == _it->first) && (it.second <= 1)) {
                    continue;
                }
                nums.first = it.first;
                nums.second = _it->first;
                return true;
            }
        }
        return false;
    }
};

